import React, { Component } from 'react';
import "../style/style.css";
import "../style/bootstrap.min.css";

const list_article = [{number:"#1",title:"Liverpool breaking records and opponents' resolve"},
                  {number:"#2",title:"These high-speed ice skaters hit hills and dips at 50 mph"},
                  {number:"#3",title:"Vandals topple Zlatan Ibrahimovic statue in Sweden"},
                  {number:"#4",title:"Yamaha's steely supremo Lin Jarvis eyes return to MotoGP glory"},
                  {number:"#5",title:"America's Cup: Revolutionary 'flying' yachts take Auld Mug into new realm"}]

class TopArticle extends Component {
  render() {
    return (
        <div>
          <div className="row">
            <div className="col-6">
              <span>BERITA TERKINI</span>
            </div>
            <div className="col-6">
              <a href="#">lihat semua</a>
            </div>
          </div>
          <div className="row">
            <ul className="list-unstyled">
              {list_article.map(data => (
                  <li className="article-list">
                      <p>{data.number}</p>
                      <a href="#">{data.title}</a><br />
                  </li>
                )
              )}
            </ul>
          </div>
        </div>
    );
  }
}

export default TopArticle;
